export function svg2pdf(svg: SVGElement): jsPDF {
    const w = Number(svg.style.width);
    const h = Number(svg.style.height);
    let ans: jsPDF;
    if(w > h) ans = new jsPDF("l", "px");
    else ans = new jsPDF("p", "px");
    const pw = ans.internal.pageSize.getWidth();
    const ph = ans.internal.pageSize.getHeight();
    const wr = pw/w;
    const hr = ph/h;
    const rate = Math.min(wr, hr);
    ans.addSVG(svg.outerHTML, 0, 0, w*rate, h*rate);
    //ans.output("datauristring");
    return ans;
}
function svginpdf(pdf: jsPDF, svg: SVGElement, page: number) {
    const w = Number(svg.style.width);
    const h = Number(svg.style.height);
    let ans: jsPDF;
    if(w > h) pdf.addPage("A4", "l");
    else pdf.addPage("A4", "p");
    pdf.setPage(page);
    const pw = pdf.internal.pageSize.getWidth();
    const ph = pdf.internal.pageSize.getHeight();
    const wr = pw/w;
    const hr = ph/h;
    const rate = Math.min(wr, hr);
    pdf.addSVG(svg.outerHTML, 0, 0, w*rate, h*rate);
}
export function svgs2pdf(svgs: SVGElement[]): jsPDF|null {
    if(svgs.length === 0) return null;
    let ans = svg2pdf(svgs[0]);
    for(let i=1;i<svgs.length;i++) {
        svginpdf(ans, svgs[i], i+1);
    }
    return ans;
}
