export function jpeg2pdf(cv: HTMLCanvasElement): string {
    let ans: jsPDF;
    if(cv.width > cv.height) ans = new jsPDF("l", "px");
    else ans = new jsPDF("p", "px");
    const pw = ans.internal.pageSize.getWidth();
    const ph = ans.internal.pageSize.getHeight();
    const wr = pw/cv.width;
    const hr = ph/cv.height;
    const rate = Math.min(wr, hr);
    ans.addImage(cv.toDataURL("image/jpeg"), "JPEG", 0, 0, cv.width*rate, cv.height*rate);
    return ans.output("datauristring");
}
